-- Triggers `loan_repayments`
--
DELIMITER $$
CREATE TRIGGER `auto_update_loan_balance` AFTER INSERT ON `loan_repayments` FOR EACH ROW BEGIN
    -- Subtract the payment from the main loan balance
    UPDATE loans 
    SET current_balance = current_balance - NEW.amount_paid 
    WHERE loan_id = NEW.loan_id;

    -- Automatically mark as 'completed' if balance is 0 or less
    UPDATE loans 
    SET status = 'completed' 
    WHERE loan_id = NEW.loan_id AND current_balance <= 0;
END
$$
DELIMITER ;

